import React from 'react';

function AboutMe() {
    return (
        <article className="aboutMe">
            Meu nome é Robertson, sou formado em Pedagogia, pós-graduado em Educação Especial com Ênfase em Deficiência Auditiva e desenvolvedor FullStack.
        </article>
    );
};

export default AboutMe;
